import { Component, OnInit } from '@angular/core';
import { Member } from 'src/app/_models/member';
import { Pagination } from 'src/app/_models/pagination';
import { UserParams } from 'src/app/_models/userParams';
import { MembersService } from 'src/app/_services/members.service';
import { FormsModule } from '@angular/forms';

@Component({
  selector: 'app-member-list',
  templateUrl: './member-list.component.html',
  styleUrls: ['./member-list.component.css']
})
export class MemberListComponent implements OnInit {
  members: Member[] = [];
  pagination: Pagination | undefined;
  userParams: UserParams | undefined;
  genderList = [{ value: 'male', display: 'Males' }, { value: 'female', display: 'Females' }]

  constructor(private memberService: MembersService) {
    this.userParams = this.memberService.getUserParams();
  }

  ngOnInit(): void {
    // this.member$ = this.memberService.getMembers();
    this.loadMembers()
  }

  loadMembers() {
    if (this.userParams) {
      this.memberService.setUserParams(this.userParams);
      this.memberService.getMembers(this.userParams).subscribe({
        next: response => {
          if (response.result && response.pagination) {
            this.members = response.result;
            this.pagination = response.pagination;
          }
        }
      })
    }
  }

  resetFilters() {
    this.userParams = this.memberService.resetUserParams();
    this.loadMembers();
  }

  pageChanged(event: any) {
    if (this.userParams && this.userParams?.pageNumber !== event.page) {
      this.memberService.setUserParams(this.userParams);
      this.userParams.pageNumber = event.page;
      this.loadMembers();
    }
  }
}
<div class="text-center mt-3">
  <h2>Your matches - {{pagination?.totalItems}} found</h2>
</div>

<div class="container mt-3" *ngIf="userParams">
  <form #form="ngForm" class="d-flex mb-3" (ngSubmit)="loadMembers()"
      autocomplete="off">
      <div class="d-flex mx-2">
          <label class="col-form-label">Age from: </label>
          <input
              type="number"
              class="form-control ms-1"
              style="width: 70px;"
              name="minAge"
              [(ngModel)]="userParams.minAge">
      </div>
      <div class="d-flex px-2">
          <label class="col-form-label">Age to: </label>
          <input
              type="number"
              class="form-control ms-1"
              style="width: 70px;"
              name="maxAge"
              [(ngModel)]="userParams.maxAge">
      </div>

      <div class="d-flex px-2">
          <label class="col-form-label me-2">Show: </label>
          <select name="gender" style="width: 130px;" class="form-select ml-1" [(ngModel)]="userParams.gender">
              <option *ngFor="let gender of genderList" [value]="gender.value">
                  {{gender.display}}
              </option>
          </select>
      </div>

      <button class="btn btn-primary ms-1" type="submit">Apply Filters</button>
      <button (click)="resetFilters()" class="btn btn-info ms-1" type="submit">Reset Filters</button>
      <div class="col">
          <div class="btn-group float-end">
              <button
                  type="button"
                  class="btn btn-primary"
                  name="orderBy"
                  (click)="loadMembers()"
                  btnRadio="lastActive"
                  [(ngModel)]="userParams.orderBy">Last Active</button>
              <button
                  type="button"
                  class="btn btn-primary"
                  name="orderBy"
                  (click)="loadMembers()"
                  btnRadio="created"
                  [(ngModel)]="userParams.orderBy">Newest members</button>
          </div>
      </div>

  </form>
</div>

<div class="row">
  <div *ngFor="let member of members" class="col-2">
      <app-member-card [member]="member"></app-member-card>
  </div>
</div>

<div class="d-flex justify-content-center" *ngIf="pagination">
  <pagination
      [boundaryLinks]="true"
      [totalItems]="pagination.totalItems"
      [itemsPerPage]="pagination.itemsPerPage"
      [(ngModel)]="pagination.currentPage"
      (pageChanged)="pageChanged($event)"
      [maxSize]="10"
      previousText="&lsaquo;"
      nextText="&rsaquo;"
      firstText="&laquo;"
      lastText="&raquo;">
  </pagination>
</div>
